library(shiny)

ui <- fluidPage(
  titlePanel("Login"),

  sidebarLayout(
    sidebarPanel(
      textInput("username", "Username"),
      passwordInput("password", "Password"),

      actionButton("login", "Login")
    ),

    mainPanel(
      h2("Welcome!"),

      tags$p("You have logged in successfully.")

    )
  )
)

server <- function(input, output, session) {

