```rust
use mysql::*;
use mysql::prelude::*; 

fn main() {
    \/\/ Connect to the database
    let url = "mysql:\/\/username:password@localhost:3306\/database_name";
    let pool = Pool::new(url)?;
    let mut conn = pool.get_conn()?;

    \/\/ Insert a record
    let sql = "INSERT INTO table_name (column1, column2) VALUES (?, ?)";
    let params = params!["value1", "value2"];
    conn.exec_drop(sql, params)?;

    \/\/ Query records
    let sql = "SELECT * FROM table_name";
    let mut result = conn.query(sql)?;

    while let Some(row) = result.next()? {
        let id: i32 = row.get(0)?;
        let name: String = row.get(1)?;
        println!("id: {}, name: {}", id, name);
    }

    \/\/ Update a record
    let sql = "UPDATE table_name SET column1 = ? WHERE id = ?";
    let params = params!["new value", "1"];
    conn.exec_drop(sql, params)?;

    \/\/ Delete a record
    let sql = "DELETE FROM table_name WHERE id = ?";
    let params = params!["1"];
    conn.exec_drop(sql, params)?;
}
```

